import React from 'react';
import { Left } from 'react-bootstrap/lib/Media';

class Header extends React.Component {



    render () {
        const navMenuStyle = {
            color: "red",
            marginLeft: "auto"
        };

        return (
            <div className="container">
                <div className="row">
                    <div className="col">Test 33</div>
                    <div className="col" style={navMenuStyle}>Test 67</div>
                </div>
            </div>
        );
    }
}

export default Header;
